import React from "react";
import { Card } from "antd";

const PostCard = ({ post }) => {
  return (
    <div>
      <Card cover={post.Images[0] && <PostImages images={post.images} />}>
        <Image />
        <Content />
      </Card>
    </div>
  );
};

export default PostCard;
